import React, { useEffect } from "react";
import { useDispatch } from "react-redux"
import { getProducts } from "../../../redux/productActions"

const Home = () => {

    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(getProducts())
    })


    return (
        <div>
            <p>Soy el home</p>
        </div>
    )

}

export default Home;
